import React, { Component } from 'react'
import DashBoardNavBar from '../DashBoardNav/DashBoardNavBar'
import profile from '../../assets/img/undraw_profile_pic_ic5t.svg'



class TeamView extends Component {
    constructor(props){
        super(props);

        this.state = {
            data: {
                firstname: 'Ayooluwa',
                profilepic: profile,
                timeofftypes: [
                  'Holiday', 
                  'Maternity Leave', 
                  'Paternity Leave', 
                  'Sick Leave (Up to 10 Days)'
              ],
                manager: 'Mr Mayowa'
              }
        }
    }

    render(){
        return(
            <div>
                <DashBoardNavBar data={this.state.data}/>
            <div className="container-fluid main">
                <div className="row">

                        <span>{this.state.data.manager}bbbbbbbbbbbbbbbbbbbbbb</span>
                    </div>
                </div>
            </div>


        )
    }
}
export default TeamView;
